		let _common_cache_bounds = new createjs.Rectangle( -75 , -150 , 150 , 300 );
		
		let _hero_anchor = { x : 384 , y : 875 } ; 
		let _tutorial_baddie_anchor = { x : 384 , y : 520 } ; 
		let _hero ;
		
		function set_hero( _lib_reference ) {
			//
			_hero = new _lib_reference() ;
			_active_container.addChild( _hero );
			//
			_hero.bounds = _hero.getBounds(); 
			_hero.cache( -50 , -50 , 100 , 100 );
			_hero.hit = on_hero_hit ;
		}
		//
		function on_hero_hit( _orientation ){ 
			// this.health-- ;
			shake( _root , 8 );
			spark( this , _orientation );
			explode( this ); 
			if( this.health <= 0 ){
				// 
			}
		}
		
		function clear_hero(){
			if( _hero ){
				_hero.parent.removeChild( _hero );
				_hero.hit = null ;
				_hero = null ;
			}
		}
		
		
		let _active_container = _root.menu_container ;  
		let _bg_container = _root.bg_container ; 
		
		let _background_scroll = [ _background0 , _background1 , _background2 ];
