		//
		function get_random_property( _object ){ 
			
			let _i = Math.round( Math.random() * get_property_count( _object ) ) - 1 ; 
			let _count = 0;
			let _random ;
			
			for( _o in _object ){
				if( _count == _i ){
					_random = { key:_o , value:_object[ _o ] } ;
					break ;
				}
				_count++ ;
			}
			return _random ;
		}
		//
		function get_property_count( _object ){
			let _length = 0 ;
			for( _i in _object ){
				_length++ ;
			}
			return _length ;
		}
		// this function consideres a badie locked for key evaluation to string 
		function test_key( _key ){
				
			// get the container for each to be analyzed
			let _f = _locked.label.container ;
			//
			if( _f[ _locked.label.strike ].text == _key && GAME.shooting_enabled ) {
				//
				count_accuracy( 1 );  
				// strike current key graphic
				_f[ _locked.label.strike ].set({
					color: "#ff0000"
				})
				// send projectile graphic 
				generate_projectile( _locked );
				_locked.label.strike++ ;
			
				GAME.score++ ;
			
				if( _locked.label.strike >= _locked.label.text.length ){
					unlock( _locked , false );
				}
				// handle tab? ;
			
			} else if ( _key == 'Escape' || _key == 'Backspace' && _current_game_state != STATE_TUTORIAL ){
				// reset contents and back out
				unlock( _locked , true ) ;
				for( _k in _f ){ 
					_f[ _k ].set({
						color: "#ffffff"
					})
				} 
			} else if ( _i == _baddies.length - 1 ) { // key has no matches 
				// check for capslock and notify user by shake
				if( window.capsLockEnabled && _f[ _locked.label.strike ].text.toUpperCase() == _key && _f[ _locked.label.strike ].text != _key ){ 
					shake( _capslock );
					flash( _capslock );
					//_string.toUpperCase() === _string && _string.toLowerCase()
				}
				count_accuracy( -1 ); 
			} 
		}
		
		function on_key( _event ){
		
			GAME.player_idle = 100 ;
			// handle text list 
			check_capslock( _event ); // 
			if( _event.key == 'Enter' ){	
				// 
				if( _current_game_state == STATE_PLAY ){
					createjs.Tween.get( _blast_counter ).to( { scale: 2 } , 200 ).to({ scale:1 } , 600 , createjs.Ease.elasticOut ) ;
					blast( _hero ); 
				} else {
					createjs.Sound.play( _button_audiolib[ 0 ] ); 
					if( _current_game_state == STATE_MENU ){
						if( _menu_buttons.selected == _root.menu_container.start_button ){
							start_game() 
						} else if( _menu_buttons.selected == _root.menu_container.tutorial_button ){
							start_tutorial();
						} else if( _menu_buttons.selected == _root.menu_container.options_button ){
							start_options();
						}
						
					} else if ( _current_game_state == STATE_TUTORIAL ){  
						blast( _hero );
						
					} else if ( _current_game_state == STATE_OVER ){ 
						clear_game();
						
					} 
				}
			} else if ( _current_game_state == STATE_MENU ){
				if( _event.key == 'ArrowDown' ){
					_menu_buttons.next();
				} else if( _event.key == 'ArrowUp' ){
					_menu_buttons.previous();
				}
			}
			// only qualify input characters for evaluation 
			if( _valid_characters.includes( _event.key ) && ( _current_game_state == STATE_PLAY  ||  _current_game_state == STATE_TUTORIAL ) ){
				
				if( _locked ){ // badie locked, no need to further evaluation
					test_key( _event.key ); 
				} else {
					// lock if available 
					for( _i in _baddies ){
						// lock on 
						if( _baddies[ _i ].label.strike <= _baddies[ _i ].label.container.length-1 ){
							if( _baddies[ _i ].label.container[ _baddies[ _i ].label.strike ].text == _event.key ) { 
								// lock onto clip 
								lock( _baddies[ _i ] ); 
								break; 
							}
						}
						// key hit for the current active character in content && _locked evaluation 
						if( !_j.ded ){
						}
					}
					// did a key match ? 
					if( _locked ){
						test_key( _event.key ); 
					} else {
						count_accuracy( -1 );
					}
				}
			} else if ( _current_game_state == STATE_MENU ) {
				
			}
		}
