		function blast( _source ){
			// power bo-omb	
			if( GAME.blasts > 0 && GAME.blasts_enabled ){
				let _i_blast = _blast = new lib.Projectile2();  
				GAME.blasts-- ; 
				_blast_counter.count.text = GAME.blasts ;
				_active_container.addChild( _i_blast ); 
				createjs.Sound.play( _xplod_audiolib[ 2 ] );
				_i_blast.width = 80 ; // <= arbitrary value to compensate createjs' omitted values to be used to calculate the blast radius 
				_i_blast.scale =  0.1 ;
				_i_blast.x = _source.x ;			
				_i_blast.y = _source.y ;
				createjs.Tween.get( _i_blast , { override:true } ).to( { scale:10 , alpha:1 } , 500 ).call( on_blast_complete ).addEventListener("change", on_blast_update ); 
				shake( _source );
				flash( _source );
				flash( _i_blast );
			} else {
				// dud
				shake( _blast_counter ) ;
				createjs.Sound.play( _exed_audiolib[ 0 ] );
			}
		}
		
		function on_blast_cancel( ){
			this.parent.removeChild( this );
		}
		
		function on_blast_complete( ){
			createjs.Tween.get( this ).to( { scale:12 , alpha:0 } , 500 , createjs.Ease.quintOut ).call( function(){ this.parent.removeChild( this ) } ) ;  
		}
		
		function on_blast_update(){ 
			let _radius = ( _blast.width * _blast.scale ) / 2 ;
			// 
			// blast all within radious
			for( _i in _baddies ){
				let _i_distance = get_distance( _blast , _baddies[ _i ].container ) ;
				// destroy all within bounds 
				if( _i_distance < _radius ){ 
					_baddies[ _i ].active = true ;
					_baddies[ _i ].health = 0 ;
					_baddies[ _i ].hit( find_radian( _blast , _baddies[ _i ].container ) );
				}
			}
		}
		
