		function projectile_move_update(){
			if( Boolean( this.target ) ){
				//
				let _distance = get_distance( this.container , this.target.container ); 
				let _orbit = orbit( this.graphic , this.container , _distance * 0.0001 * this.inverted * this.life * clamp( GAME.time , 0 , 2500 ) , GAME.time * 3.5 * this.inverted );
				//
				if( this.last_position && this.graphic ){
					this.graphic.rotation = find_degrees( this.graphic , this.last_position ) - 90 ;
					this.last_position.x = this.graphic.x ;
					this.last_position.y = this.graphic.y ;
				}
				this.life += .046 ;
			} else {
				this.destroy();
			}
		}
		
